我觉得是 catserver 的问题了
https://www.mcbbs.net/forum.php? ... 916130&pid=15659212
确实是因为多线程的原因，即使是指令传送也不能是多线程内执行的。runTaskLater() 刚好可以解决.谢谢。
Main.main.getServer().getScheduler().runTaskLater(Main.main, new BukkitRunnable() {
@Override
public void run() {
        //传送代码
}
}, 1L);
